import ProjectCard from "./ProjectCard";
import ArrowButton from "../ArrowButton";

function Projects() {
  return (
    // Added max-w-screen-xl to constrain the content width on large screens,
    // and mx-auto to center that container horizontally.
    <div className="max-w-screen-xl mx-auto p-4">
      <p className="text-center">Browse My Recent</p>
      <h1 className="text-[3rem] text-center font-bold">Projects</h1>

      {/* The inner container remains flexible for the cards. */}
      <div className="flex justify-center">
        {/* This row holds the cards. 
            We use flex-wrap to ensure the cards stack nicely on smaller screens.
            We also use justify-center to ensure the row of cards is centered 
            if it doesn't fill the full max-w width.
          */}
        <div className="flex flex-wrap justify-center gap-[2rem] my-[2rem]">
          <ProjectCard title="TeeItUp" image="/images/TeeItUp.png" />
          <ProjectCard title="Sudoku Solver" image="/images/SudokuSolver.png" />
          <ProjectCard title="Tampa Palms Website" image="/images/tppc.webp" />
        </div>
      </div>
      <div className="flex justify-center">
        <ArrowButton href="#contact" />
      </div>
    </div>
  );
}
